import { NavLink } from "react-router-dom";
import instagram from "./instagram.png";
import github from "./github.png";
import exit from "./exit.png";
import { InstagramOutlined } from "@ant-design/icons";

function Footer() {
  return (
    <>
    @Copyright 2021
      <NavLink
        to={{ pathname: "https://www.instagram.com/tenomareen/" }}
        target="_blank"
      >
        <img src={instagram} alt={"src"} height={48}></img>
      </NavLink>
      <NavLink
        to={{ pathname: "https://github.com/Tenomareen" }}
        target="_blank"
      >
        <img src={github} alt={"src"} height={48}></img>
      </NavLink>
      <NavLink
        to={{ pathname: "https://www.google.com/" }}
        target="_blank"
      >
       <InstagramOutlined style={{fontSize: "40px"}}/>
      </NavLink>
    </>
  );
}

export default Footer;
